webpackJsonp([0xe8b60dda954],{3547:function(a,e){a.exports={data:{markdownRemark:{html:'<p>PCM + 半ソフト・半ハードな XG 音源を搭載した YAMAHA YMF724/744 搭載サウンドカード。744 では 4ch サラウンド対応になった。 どうにも音圧が弱い気がしたが、単に自分自身のマスタリング知識が皆無なだけ、ということが原因と理解したのは 2005 年後半頃。 後に暫く GS 信者となっていたが、今まで触ってきた XG 音源では一番費用対効果が良い気がする。  その後PCもろとも一人暮らしの資金のためドナドナ。</p>\n<h2>この音源で制作した主な楽曲</h2>\n<ul>\n<li><a href="">オリジナル</a>(/will-o-the-wisp)</li>\n<li><a href="">オリジナル</a>(/trz-master2001)</li>\n<li><a href="">オリジナル</a>(/underground-trance)</li>\n<li><a href="">Rapis Lazulさんの BMS アレンジ</a>(/justice)</li>\n<li><a href="">オリジナル</a>(/mechanism)</li>\n<li>他多数</li>\n</ul>',frontmatter:{cover:null,date:"2000-05-01T00:00:00+09:00",strDate:"2000/4/30",title:"(2000-2004) Aopen AW724/744"}}},pathContext:{path:"/ja/blog/2000/05/01-aopen-aw724/",langKey:"ja"}}}});
